  name: XmlnsDictionary
  nameWithType: XmlnsDictionary
  fullName: System.Windows.Markup.XmlnsDictionary
  type: Class
  summary: "Representerar en ordlista som innehåller mappningar xmlns för XAML-namnområden i WPF."
  remarks: "XmlnsDictionary mappar XAML namnområdesprefix med det fullständiga XAML-namnområdet-URI. För XAML-användning i program och XAML-namnområden i allmänhet URI: N är ofta inte en schema-format URI som innehåller `http://`. Det är i stället en användardefinierad mappning till en CLR-namnområde och sammansättningen. Att sammansättningen innehåller säkerhetskopiering typer som det hänvisas till. Mer information finns i [XAML namnområden och Namespace mappning för WPF XAML](~/add/includes/ajax-current-ext-md.md).       XmlnsDictionary lägger till begreppet omfattning för en XAML-namnområdet. Standard <xref:System.Collections.IDictionary>kan innehålla prefixet nycklar och värden för XML-namnområdet URI.</xref:System.Collections.IDictionary> Scope-begrepp i XmlnsDictionary parallels XML-koncept ett prefix kan omdefinieras. I så fall gäller omdefinieringen endast på den nivån eller nedan i vyn DOM XML (tidigare definitionen gäller på högre nivå i DOM). Scope-konceptet representeras främst direkt i XmlnsDictionary-API, så att du kan anropa API: er som <xref:System.Windows.Markup.XmlnsDictionary.LookupNamespace%2A>utan att fråga om scope.</xref:System.Windows.Markup.XmlnsDictionary.LookupNamespace%2A> Dock XmlnsDictionary exponerar <xref:System.Windows.Markup.XmlnsDictionary.PushScope%2A>och <xref:System.Windows.Markup.XmlnsDictionary.PopScope%2A>så att en anpassad <xref:System.Windows.Markup.ParserContext>implementering som ändrar omfånget kan synkronisera med omfång för XmlnsDictionary.</xref:System.Windows.Markup.ParserContext> </xref:System.Windows.Markup.XmlnsDictionary.PopScope%2A> </xref:System.Windows.Markup.XmlnsDictionary.PushScope%2A>      <a name=&quot;xamlTextUsage_XmlnsDictionary&quot;></a>## XAML Text användning"
  syntax:
    content: 'public class XmlnsDictionary : System.Collections.IDictionary, System.Xaml.IXamlNamespaceResolver'
  inheritance:
  - System.Object
  implements:
  - System.Collections.IDictionary
  - System.Xaml.IXamlNamespaceResolver
  inheritedMembers: []
